const Card = ({ itemData }) => {
    console.log("this is card", itemData);
    const { brand, image } = itemData;
    console.log(image);
    console.log('../images/phantom2.png');
    const productImage = require('../images/phantom2.png');
    const productIcon = require(image);
    return (
        <div>
            <img src={productImage} />
            <img src={productIcon} />
            <h1>{itemData.productName}</h1>
            <p>{itemData.price} {itemData.unit}</p>
            <p>{brand}</p>
        </div>
    )
}

export default Card;
